import React from 'react';
import { Grid, Slider, Typography } from '@material-ui/core';

function DataControls() {
    return(
        <>
            <Typography variant="subtitle1" style={{margin:"20px"}}>Data Controls</Typography>

            <Grid container spacing={2}>
                <Grid item>
                  <Typography variant="body1">10</Typography>
                </Grid>
                <Grid item xs>
                <Slider value={50} aria-labelledby="continuous-slider" />
                </Grid>
                <Grid item>
                  <Typography variant="body1">1000</Typography>
                </Grid>
                <Grid item>
                  <Typography variant="body1">Data Size</Typography>
                </Grid>
            </Grid>
        </>
    );
}

export default DataControls;
